import { StyleSheet, Text, View, TextInput, Button } from 'react-native';

export default function App() {
  return (
    <View style={{padding: 50}}>
      <View style={{
          flexDirection: 'row',
          justifyContent: 'space-between',
          alignItems: 'center'}}>

            <TextInput 
              placeholder='Course Goals'
              style={{
                width: '80%',
                borderColor: 'black',
                borderWidth: 1,
                padding: 10
              }} />

            <Button title='A' />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({});
